import React from 'react';
import '../styles/ProductSection.css';

const products = [
  { id: 1, name: 'T-Shirt', price: '¥2,000', image: 'https://images.unsplash.com/photo-1513694203232-719a280e022f?auto=format&fit=crop&w=400&q=80' },
  { id: 2, name: 'Shoes', price: '¥5,000', image: 'https://images.unsplash.com/photo-1513694203232-719a280e022f?auto=format&fit=crop&w=400&q=80' },
  { id: 3, name: 'Watch', price: '¥7,000', image: 'https://images.unsplash.com/photo-1513694203232-719a280e022f?auto=format&fit=crop&w=400&q=80' },
  { id: 4, name: 'Jacket', price: '¥9,000', image: 'https://images.unsplash.com/photo-1513694203232-719a280e022f?auto=format&fit=crop&w=400&q=80' },
  { id: 5, name: 'Jeans', price: '¥4,000', image: 'https://images.unsplash.com/photo-1513694203232-719a280e022f?auto=format&fit=crop&w=400&q=80' },
  { id: 6, name: 'Sunglasses', price: '¥3,000', image: 'https://images.unsplash.com/photo-1513694203232-719a280e022f?auto=format&fit=crop&w=400&q=80' },
  { id: 7, name: 'Hat', price: '¥1,500', image: 'https://images.unsplash.com/photo-1513694203232-719a280e022f?auto=format&fit=crop&w=400&q=80' },
  { id: 8, name: 'Backpack', price: '¥6,000', image: 'https://images.unsplash.com/photo-1513694203232-719a280e022f?auto=format&fit=crop&w=400&q=80' },
  { id: 9, name: 'Hat', price: '¥1,500', image: 'https://images.unsplash.com/photo-1513694203232-719a280e022f?auto=format&fit=crop&w=400&q=80' },
  { id: 10, name: 'Backpack', price: '¥6,000', image: 'https://images.unsplash.com/photo-1513694203232-719a280e022f?auto=format&fit=crop&w=400&q=80' }
];

const ProductSection = () => (
  <div className="product-section">
    <h2>Featured Products</h2>
    <div className="products">
      {products.map(product => (
        <div className="product-card" key={product.id}>
          <img src={product.image} alt={product.name} />
          <h3>{product.name}</h3>
          <p>{product.price}</p>
        </div>
      ))}
    </div>
  </div>
);

export default ProductSection;
